mapper.select:
select 

from mjymx
where FRDM_U = #{FRDM_U,jdbcType=VARCHAR}
  and JYRQ_U = #{JYRQ_U,jdbcType=DATE}
  and JYLS_U = #{JYLS_U,jdbcType=VARCHAR}

mapper.delete:
delete from mjymx
where FRDM_U = #{FRDM_U,jdbcType=VARCHAR}
  and JYRQ_U = #{JYRQ_U,jdbcType=DATE}
  and JYLS_U = #{JYLS_U,jdbcType=VARCHAR}
